void radarComponent::AddStation(char *stationinfo)
{
IPADDR adr;
double latitude,longitude;
char *name;
	if (*stationinfo!='#' || toupper(stationinfo[1])!='R')
		return;
	char *t=strchr(stationinfo+2,',');
	if (t) {
		*t='\0';
		adr.SetAddr(stationinfo+2);
		stationinfo=t+1;
		t=strchr(stationinfo,',');
		if (t) {
			*t='\0';
			latitude=strtod(stationinfo,NULL);
			stationinfo=t+1;
			t=strchr(stationinfo,',');
			if (t) {
				*t='\0';
				longitude=strtod(stationinfo,NULL);
				stationinfo=t+1;
				while (*stationinfo && isspace(*stationinfo))
					stationinfo++;
				t=strchr(stationinfo,'\0');
				while (--t>=stationinfo && isspace(*t)) {
					*t='\0';
				}
				name=stationinfo;
			}
			else
				return;
		}
		else
			return;
	}
	else
		return;

	Station *s=Stations;
	
	while (s) {
		if (adr.GetAddr()==s->adr.GetAddr() || (latitude==s->latitude && longitude==s->longitude)) {
			s->Stop();
			if (s->status==Station::LINKUP && s->connection.remoteaddr.GetAddr()!=adr.GetAddr()) {
				s->connection.Close();
				s->connection.remoteaddr=adr;
				
			}
			if (1) { //s->connection.Open()) {
				const ScopedLock updatelock (mutex);
				s->status=Station::LINKUP;
				s->adr=adr;
				s->latitude=latitude;
				s->longitude=longitude;
				if (s->name)
					delete s->name;
				s->name=new char[strlen(name)+1];
				if (s->name)
					strcpy(s->name,name);
				s->Start();
				return;
			}
			else {
				// cannot connect, discard
				s->Stop();
				const ScopedLock updatelock (mutex);
				if (s==Stations) {
					Stations=s->nextstation;
					delete s;
				}
				else {
					Station *t=Stations;
					while (t->nextstation) {
						if (t->nextstation==s) {
							t->nextstation=s->nextstation;
							delete s;
							break;
						}
						t=t->nextstation;
					}
				}
				return;
			}
		}
		s=s->nextstation;
	}
	// not found, have to add
	{
		const ScopedLock updatelock (mutex);
		s=new Station(adr,latitude,longitude,name);
		if (1) { //s->connection.Open())
			s->status=Station::LINKUP;
			s->nextstation=Stations;
			Stations=s;
			s->Start();
			return;
		}
		delete s;
	}
}
